import { Menu } from 'antd'
import React, { Component } from 'react'

export default class ArtistList extends Component {
    render() {
        return (
            <>
                <Menu mode="horizontal">
                    <Menu.Item key="male">男</Menu.Item>
                    <Menu.Item key="male">女</Menu.Item>
                    <Menu.Item key="male">男</Menu.Item>
                </Menu>
            </>
        )
    }
}
